import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '40px',
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  sliderContainer: {
    width: '100%',
    maxWidth: '100%',
    margin: '20px 0',
  },
  carouselContainer: {
    boxSizing: 'none',
  },
  carouselImage: {
    width: '100%',
    height: '100%',
    objectFit: 'cover',
  },
  missionSection: {
    marginTop: '100px',
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  missionCard: {
    width: '30%',
    border: '1px solid #ddd',
    borderRadius: '8px',
    overflow: 'hidden',
    margin: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  missionImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  missionCardContent: {
    padding: '15px',
  },
  missionTitle: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  missionDescription: {
    fontSize: '1rem',
    color: '#555',
  },
  eventsSection: {
    marginTop: '100px',
    display: 'flex',
    justifyContent: 'space-around',
    flexWrap: 'wrap',
  },
  eventCard: {
    width: '30%',
    border: '1px solid #ddd',
    borderRadius: '8px',
    overflow: 'hidden',
    margin: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  eventImage: {
    width: '100%',
    height: '200px',
    objectFit: 'cover',
  },
  eventCardContent: {
    padding: '15px',
  },
  eventTitle: {
    fontSize: '1.2rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  eventDescription: {
    fontSize: '1rem',
    color: '#555',
  },
  registerButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginTop: '10px',
  },
  clubSection: {
    display: 'flex',
    justifyContent: 'space-around',
    alignItems: 'center',
    marginTop: '100px',
  },
  clubCircle: {
    textAlign: 'center',
    margin: '10px',
  },
  clubImageContainer: {
    position: 'relative',
  },
  clubImage: {
    width: '150px',
    height: '150px',
    borderRadius: '50%',
    marginBottom: '10px',
  },
  joinButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    position: 'absolute',
    bottom: '-20px',
    left: '50%',
    transform: 'translateX(-50%)',
  },
    aboutSection: { // Corrected key name
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      marginTop: '100px', /* Adjust margin-top as needed */
    },
    aboutContent: { // Adjusted key name
      textAlign: 'center',
    },
    aboutTitle: { // Adjusted key name
      fontSize: '2rem',
      fontWeight: 'bold',
      marginBottom: '20px',
    },
    aboutDescription: { // Adjusted key name
      fontSize: '1.2rem',
      color: '#555',
    },
  main: {
    flex: 1,
    padding: '20px',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '30px',
    bottom: 0,
    width: 'auto',
  },
};

const Header = () => (
  <header style={styles.header}>
    {/* Removed website name */}
  </header>
);

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.navUl}>
      <li style={styles.navLi}>Home</li>
      <li style={styles.navLi}>Our Missions</li>
      <li style={styles.navLi}>About Us</li>
      <li style={styles.navLi}>Clubs</li>
      <li style={styles.navLi}>Contact Us</li>
    </ul>
    <div style={styles.loginButton}>Login</div>
  </nav>
);

const ImageSlider = () => (
  <div style={styles.sliderContainer}>
    <Carousel showThumbs={false} autoPlay infiniteLoop interval={2000} style={styles.carouselContainer}>
      <div>
        <img alt="Slide 1" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
      <div>
        <img alt="Slide 2" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
      <div>
        <img alt="Slide 3" src="https://via.placeholder.com/800x300" style={styles.carouselImage} />
      </div>
    </Carousel>
  </div>
);

const MissionCard = ({ title, description, imageUrl }) => (
  <div style={styles.missionCard}>
    <img alt={title} src={imageUrl} style={styles.missionImage} />
    <div style={styles.missionCardContent}>
      <h3 style={styles.missionTitle}>{title}</h3>
      <p style={styles.missionDescription}>{description}</p>
    </div>
  </div>
);

const EventCard = ({ title, description, imageUrl }) => (
  <div style={styles.eventCard}>
    <img alt={title} src={imageUrl} style={styles.eventImage} />
    <div style={styles.eventCardContent}>
      <h3 style={styles.eventTitle}>{title}</h3>
      <p style={styles.eventDescription}>{description}</p>
      <button style={styles.registerButton}>Register Now</button>
    </div>
  </div>
);

const AboutSection = () => (
  <div style={{ ...styles.aboutSection, marginTop: '150px', marginBottom: '75px', display: 'flex', alignItems: 'left', justifyContent: 'left' }}>
    <div style={{ display: 'flex', alignItems: 'left' }}>
      <img
        src="https://via.placeholder.com/125x250"
        alt="Placeholder"
        style={{ width: '200px', height: 'auto', marginRight: '100px' }}
      />
      <div>
        {/* <h1 style={{ textAlign: 'center', marginBottom: '20px' }}>About Us</h1> */}
        <p>This is the About Us section content.</p>
      </div>
    </div>
  </div>
);
